import { Box, Typography, Grid } from "@material-ui/core";

function HomePage() {
  return (
    <Box>
      <Grid container style={{ width: "100%" }}>
        <Grid item xs={6}>
          <Box height="500px" bgcolor="green"></Box>
        </Grid>
        <Grid item xs={6}>
          <Box height="500px" bgcolor="red"></Box>
        </Grid>
      </Grid>
    </Box>
  );
}

export default HomePage;
